import React from "react";
import logo from "../src/Images/logo.png";
import "./App.css";






function App() {
  return (
    <div className="navbar">
      <a className="active" href="#">
        Home
      </a>
      <a href="#">Search</a>
      <a href="#">Contact</a>
      <a href="#">Login</a>
    </div>
  );

}

export default App;
